// userService.js

import { setUsers } from '../redux/userSlice';
import store from'../redux/store/'

export const fetchUsers = async () => {
  try {
    const response = await fetch('https://api.github.com/search/repositories?q=created:%3E2017-10-22&sort=stars&order=desc');
    const data = await response.json();
    // Dispatch the setUsers action to store the users in the Redux state
    store.dispatch(setUsers(data));
  } catch (error) {
    console.error('Error fetching users:', error);
  }
};
